INSERT INTO `questions` (`id`, `answer_a`, `answer_b`, `answer_c`, `answer_d`, `answer_e`, `answer_f`, `answer_g`, `answer_h`, `answer_i`, `answer_j`, `answer_permutation`, `content`, `group_id`, `question_type`, `right_answer`, `suggest`, `user_id`) VALUES
(1, 'Bill said that he had never been to Russia and he thought he would go there the next year.', 'Bill said that he had never been to Russia and he thought he would go there the next year.', 'Bill said that he had never been to Russia and he thought he would go there the next year.', 'Bill said that he had never been to Russia and he thought he would go there the next year.', NULL, NULL, NULL, NULL, NULL, NULL, 'A,B,C,D', 'Bill said that he had never been to Russia and he thought he would go there the next year.', NULL, 'ONE_ANSWER', 'A', '<div class=\"answer-result\">\n	<p>Đáp án A</p>\n	<p>Câu ban đầu: Bill nói “Tôi chưa đến nước Nga bao giờ. Tôi nghĩ tôi sẽ đến đó vào năm tới.”</p>\n	<p>Đáp án B, C, D đều sai về mặt ngữ pháp vì khong lùi thì động từ “think” khi chuyển từ câu trực tiếp sang gián tiếp.</p>\n</div>', 4),
(2, 'Jane is believed to have retired because of her poor health.', 'Jane was believed to have retired because of her poor health.', 'It is believed that Jane retired because of her poor health.', 'Jane retired because of her poor health was believed.', NULL, NULL, NULL, NULL, NULL, NULL, 'A,B,C,D', 'People believed that Jane retired because of her poor health.', NULL, 'ONE_ANSWER', 'B', '<div class=\"answer-result\">\n	<p>Đáp án B</p>\n	<p>Câu ban đầu: Mọi người đã tin rằng Jane nghỉ hưu bởi vì sức khỏe yếu của mình.</p>\n	<p>Câu này đang ở thì quá khứ đơn nên ta loại luôn đáp án A và C (sai thì).</p>\n	<p>Đáp án D sai ngữ pháp.</p>\n	<p>Ta chọn đáp án B theo đúng cấu trúc dạng bị động.</p>\n</div>', 4),
(3, 'The government knows the extent of the problem whereas it needs to take action soon.', 'The government knows the extent of the problem so that it needs to take action soon.', 'Knowing the extent of the problem, the government needs to take action soon.', 'The government knows the extent of the problem, or else it needs to take action soon.', NULL, NULL, NULL, NULL, NULL, NULL, 'A,B,C,D', 'The government knows the extent of the problem. The government needs to take action soon.', NULL, 'ONE_ANSWER', 'C', '<div class=\"answer-result\">\n    <p>Đáp án C</p>\n	<p>Câu ban đầu: Chính phủ biết mức độ của vấn đề. Chính phủ cần hành động sớm.</p>\n	<p>Đáp án A và B sai ngữ pháp. Cấu trúc bị động với need đằng sau phải là Ving.</p>\n	<p>Đáp án D sai nghĩa s với câu ban đầu.</p>\n</div>', 4),
(4, 'Since the substance is very toxic, so protective clothing must be worn at all times.', 'So toxic is the substance that protective clothing must be worn at all times.', 'The substance is such toxic that protective clothing must be worn at all times.', 'The substance is too toxic to wear protective clothing at all times.', NULL, NULL, NULL, NULL, NULL, NULL, 'A,B,C,D', 'The substance is very toxic. Protective clothing must be worn at all times.', NULL, 'ONE_ANSWER', 'C', '<div class=\"answer-result\">\n	<p>Đáp án B</p>\n	<p>Câu ban đầu: Chất này rất độc. quần áo bảo hộ phải mặc bất cứ lúc nào.</p>\n	<p>Đáp án A vì đầu câu có “since” rồi nên ta không cần dùng “so” nữa và ngược lại. Nhìn chung câu này mắc lỗi ngữ pháp.</p>\n	<p>Đáp án C dùng sai cấu trúc “ ..... so ....... that ......” thành “such .... that.”</p>\n	<p>Đáp án D sai nghĩa so với câu ban đầu.</p>\n</div>', 4),
(5, 'John is studying hard in Oder not to fail the next exam', 'John is studying hard in Oder that he not fail the next exam', 'John is studying hard so as to fail the next exam', 'John is studying hard in Oder to not to fail the next exam', NULL, NULL, NULL, NULL, NULL, NULL, 'A,B,C,D', 'John is studying hard. He doesn’t want to fail the exam.', NULL, 'ONE_ANSWER', 'A', '<div class=\"answer-result\">\n	<p>Đáp án A</p>\n	<p>Cấu trúc: In order (not) to + V = So as (not) to: để (không) làm gì</p>\n	<p>In order that + Clause</p>\n	<p>Đáp án B “fail” chưa được chia ở ngôi thử 3 sổ ít</p>\n	<p>C sai nghĩa của câu</p>\n	<p>D sai cấu trúc “ In order not to”</p>\n</div>', 4);
